import './WebHeader.css'

function WebHeader() {
    return (
       <div className="webheader">
           <div className="web-option">Skills</div>
           <div className="web-option">Projects</div>
           <div className="web-option">Contact me</div>
       </div>
    )
}

export default WebHeader
